import "./searchBar.css";

const searchBar = () => {
  return (
    <div className="searchContainer">
      <input
        type="text"
        id="header-search"
        placeholder="Search blog posts"
        name="s"
      />
      <button type="submit">Search</button>
    </div>
  );
};

export default searchBar;
